import React from 'react'

const SortBar = ({data,setData}) => {
    // function that sorts by health
      const handleHealth = () => {
        const sortedData = [...data] // create a copy of array data
        sortedData.sort((a,b)=> b.health - a.health); //sort in descending order
        setData(sortedData)
      }
  return (
    <div></div>
  )
}

export default SortBar
